import React from "react";
import Navbar from "../Navbar/Navbar";
import Box from '@mui/material/Box';
export default function Home() {
    return (
        <>
        <Box sx={{displa:"flex"}}>
            <Navbar />
            <Box component="main" sx={{flexGrow:1,p:3}}>
            <h1> Home </h1>
            </Box>
        </Box>
        </>
    )
}
